import './App.css';
import Card from './components/card';
import carddata from './carddata';

function App() {

  const  addingcards = carddata.datas.map(card => {
    return(
     <Card
      id= {card.id}
      name= {card.name}
      value= {card.value}
     />)    
  })

  return (
    <div className="App">
      {addingcards}
    </div>
  );
}

export default App;
